import './App.scss';
import NameList from './Components/NameList/NameList';
import InforCard from './Components/InfoCard/InfoCard';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route exact path="/" component={<NameList />} />
        <Route exact path="/users/:id" component={<InforCard />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
